INSERT INTO `documents` (`did`, `name`, `type`, `desc`, `path`, `text`, `orientation`, `dataact`, `access`, `enabled`) VALUES
(1, 'pallet', 'TPLS', 'Document generated after pallet creation / update', '@views/Documents/Templates/pallet.php', '<!--  Help 	\r\n	\r\n	<?= GenerateBarcode($reference) ?> generates barcode	\r\n	options: \r\n	w  - width			 \r\n	h  - height			 \r\n	ts - size of text 1-5\r\n-->\r\n<table style=\"width:100%;border:none;margin:0px;\">\r\n	<tr>\r\n    	<td style=\"padding-left: 30px;width:40%;\">\r\n          	<p style=\"font-size:30px;\"><?= $name; ?></p>\r\n      		<p style=\"font-size:30px;\"><?= nl2br($address); ?></p>\r\n      	</td>\r\n      	<td>\r\n        	<p style=\"font-size:50px;\"><?= $corder; ?></p>\r\n			<p style=\"font-size:50px;\"><?= $stack; ?></p>\r\n  			<p style=\"font-size:50px;\"><?= $status; ?></p>\r\n     	</td>\r\n  	</tr>\r\n  	<tr>\r\n  		<td>\r\n        	<?= GenerateBarcode($reference,[\'w\'=>600,\'h\'=>200,\'ts\'=>5]) ?>\r\n      	</td>\r\n      	<td>\r\n       		<p style=\"font-size:112px;\"><?= $reference; ?></p>\r\n      	</td>\r\n  	</tr>\r\n  	<tr>\r\n  		<td colspan=\"2\" style=\"text-align:center\">\r\n          <small><b>Autoparts & Diagnostics Ltd</b></small>\r\n      	</td>\r\n  	</tr>\r\n</table>\r\n', 1, '', 'NjEyZGU4NjM0ODIyNw', 1),
(5, 'pallet_in', 'TPLS', '', '@views/Documents/Templates/pallet_in.php', '<!--  Help 	\r\n	\r\n	<?= GenerateBarcode($reference) ?> generates barcode	\r\n	options: \r\n	w  - width			 \r\n	h  - height			 \r\n	ts - size of text 1-5\r\n-->\r\n<div style=\"text-align: center;\">\r\n	<div style=\"height:25%;width:100%;\">\r\n		<h2>PALLET REF: <?= $reference ?></h2>		\r\n		<?= GenerateBarcode($reference,[\'w\'=>600,\'h\'=>200,\'ts\'=>5]) ?>\r\n	</div>\r\n	<div style=\"height:25%\">\r\n		<h2>JOB CODE: <?= $sorder ?></h2>		\r\n		<?= GenerateBarcode($sorder,[\'w\'=>600,\'h\'=>200,\'ts\'=>5],TRUE) ?>\r\n	</div>\r\n  	<p><?= $page.\' / \'.$maxpages ?></p>\r\n  	<p style=\"font-size:120px;\">GOODS IN</p>\r\n	<!-- Auto print script works only on html templates-->\r\n	<?php if (!empty($autoprint) && $autoprint==TRUE) :?>\r\n	<script>  \r\n		window.onload = function (){\r\n			window.print();	\r\n		}\r\n	</script>\r\n	<?php endif ?>\r\n	\r\n</div>', 0, '', 'NjEyZGU4NjM0ODIyNw', 1),
(6, 'order_stacking', 'TPLS', '', '@views/Documents/Templates/stacking_form.php', '<!--  Help 	\r\n	\r\n	GenerateBarcode($reference) generates barcode	\r\n	options: \r\n	w  - width			 \r\n	h  - height			 \r\n	ts - size of text 1-5\r\n-->\r\n<style>\r\n	table, th, td {\r\n  		border: 1px solid black;\r\n  		border-collapse: collapse;\r\n	}\r\n	\r\n	td { \r\n    	padding: 10px;\r\n	}\r\n	.value{\r\n		text-align: right;\r\n		width:300px;\r\n	}\r\n	.header{\r\n		font-weight: bold;\r\n		background-color:yellow;\r\n  		font-size:13px;\r\n	}\r\n	.palet_value{\r\n		padding: 1px;\r\n		max-width:60px;\r\n		word-wrap:break-word;\r\n		text-align: center;\r\n  		font-size:13px;\r\n	}\r\n</style>\r\n<div style=\"text-align: center;\">\r\n	<table>		\r\n	  <tr>\r\n        <td class=\"header\">CTD COLLECTION REFERENCE</td>\r\n        <td class=\"value\"><?= $reference ?></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">CUSTOMER ACCOUNT REFERENCE</td>\r\n        <td class=\"value\"><?= $owner ?></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">NUMBER OF PALLETS</td>\r\n        <td class=\"value\"><?= count($ocfg) ?></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">NET WEIGHT</td>\r\n        <td class=\"value\"></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">GROSS WEIGHT</td>\r\n        <td class=\"value\"></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">INVOICE TOTAL</td>\r\n        <td class=\"value\"></td>\r\n      </tr>\r\n      <tr>\r\n        <td class=\"header\">INVOICE NUMBER</td>\r\n        <td class=\"value\"></td>\r\n      </tr>\r\n      <tr>\r\n        <?php $totalc=0; ?>\r\n    	<?php foreach($ocfg as $row) :?>\r\n      	<?php $totalc=$totalc+$row[\'cube\']; ?>\r\n    	<?php endforeach ?>\r\n        <td class=\"header\">TOTAL CUBE</td>\r\n        <td class=\"value\"><?= $totalc ?></td>\r\n      </tr>\r\n    </table>\r\n    <br>\r\n    <table style=\"\">\r\n    	<tr>\r\n          <td class=\"header\">REFERENCE</td>\r\n          <td class=\"header\">XSNUMBER</td>\r\n          <td class=\"header\">LMH</td>\r\n          <td class=\"header\">SIZE</td>\r\n          <td class=\"header\">HEIGHT</td>\r\n          <td class=\"header\">LOCATION</td>\r\n          <td class=\"header\">B/T</td>\r\n          <td class=\"header\">CUBE</td>\r\n    	</tr>\r\n      	<?php $totalc=0; ?>\r\n    	<?php foreach($ocfg as $row) :?>\r\n    	<tr>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'reference\']) ?></td>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'xsnumber\']) ?></td>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'lmh\']) ?></td>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'size\']) ?></td>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'height\']) ?></td>\r\n          <td class=\"palet_value\"><?= $row[\'location\'] ?></td>\r\n          <td class=\"palet_value\"><?= strtoupper($row[\'B/T NR\'].$row[\'B/T\']) ?></td>\r\n          <td class=\"palet_value\"><?= $row[\'cube\'] ?></td>\r\n    	</tr>\r\n      	<?php $totalc=$totalc+$row[\'cube\']; ?>\r\n    	<?php endforeach ?>\r\n    </table>\r\n    \r\n	<!-- Auto print script works only on html templates-->\r\n	<?php if (!empty($autoprint) && $autoprint==TRUE) :?>\r\n	<script>  \r\n		window.onload = function (){\r\n			window.print();\r\n		}\r\n	</script>\r\n	<?php endif ?>\r\n</div>', 0, '{\"controller\":\"Warehouse/OrdersModel\",\"action\":\"getStackingDataFromOrder\"}', 'NjEyZGU4NjM0ODIyNw', 1),
(7, 'stock_take_email', 'TPLS', 'Used to notify creators about stock take status change', '@views/Documents/Templates/stock_take_email.php', 'Hi <?= $name ?>,<br>\r\n<br>\r\nStock Take <?= $reference ?> completed.\r\n<br><br>You can check details by clicking below link<br>\r\n<a href=\"<?= $url ?>\"><?= $url ?></a>', 0, '', 'NjEyZGU4NjM0ODIyNw', 1);
