INSERT INTO `reports` (`rid`, `rname`, `rdesc`, `rtype`, `rtables`, `rcolumns`, `rfilters`, `rinputs`, `rsql`, `access`, `enabled`) VALUES
(1, 'Incomplete Pallets', 'Shows incomplete pallets in warehouse with locations', 1, 'pallets', 'reference,\r\noperator,\r\nsupplier,\r\nsorder as \'Supplier Ref\',\r\ncustomer,\r\ncorder as \'Customer Ref\',\r\nsize,\r\nstack,\r\nheight,\r\nlocation', '', '', 'SELECT \r\nreference,\r\noperator,\r\nsupplier,\r\nsorder as \'Supplier Ref\',\r\ncustomer,\r\ncorder as \'Customer Ref\',\r\nsize,\r\nstack,\r\nheight,\r\nlocation\r\nFROM pallets\r\nWHERE status IN  (\'1\',\'25\',\'50\',\'75\')', 'NjEyZGU4NjM0ODIyNw', 1),
(2, 'Total number of Pallets by customer', 'Total number of Pallets by customer', 1, 'pallets', 'customer,\r\ncount(pid) as Total\r\ngroupBy customer', 'customer||CustomersField', NULL, 'Select\r\ncustomer as \'Customer\',\r\ncount(pid) as \'Total\'\r\nFrom pallets\r\nWHERE customer LIKE \'%@customer%\' AND status > -1\r\nGROUP By customer', 'NjEyZGU4NjM0ODIyNw', 1),
(3, 'Pallets Created By User', 'Pallets Created By User', 1, 'pallets', 'reference,\noperator\nsupplier,\nsorder as \'Supplier Ref\',\ncustomer,\ncorder as \'Customer Ref\',\nstatus,\nsize,\nstack,\nheight,\nlocation', 'operator||UserField', NULL, 'SELECT\r\nreference,\r\noperator\r\nsupplier,\r\nsorder as \'Supplier Ref\',\r\ncustomer,\r\ncorder as \'Customer Ref\',\r\nstatus,\r\nsize,\r\nstack,\r\nheight,\r\nlocation\r\nFROM pallets\r\nWHERE operator LIKE \'%@operator%\'', 'NjEyZGU3ZmZmMTg4Nw', 1),
(4, 'Pallets Movements', 'Shows all movements on pallets', 1, 'movements_history', 'mhtype as \'Movement Type\',\nmhdate as \'Date\',\nmhuser as \'Operator\',\nmhfrom as \'From\',\nmhto as \'To\',\nmhref as \'Reference\',\nmhinfo as \'Info\'', 'mhref||InputField|Pallet Reference\r\nfrom|202101010000|DateField|Date From\r\nto|202112310000|DateField|Date To', NULL, 'Select\r\n`mh`.`mhtype` as \'Movement Type\',\r\n`mh`.`mhdate` as \'Date\',\r\n`mh`.`mhuser` as \'Operator\',\r\n`mh`.`mhfrom` as \'From\',\r\n`mh`.`mhto` as \'To\',\r\n`mh`.`mhref` as \'Reference\',\r\n`mh`.`mhinfo` as \'Info\',\r\n`cus`.`name` as \'Customer\',\r\n`sup`.`name` as \'Supplier\',\r\n`pal`.`size` as `Pallet Size`,\r\n`pal`.`height` as `Pallet Height`,\r\n`pal`.`corder` as `Customer Job Code`\r\nFROM `movements_history` as `mh`\r\nLEFT JOIN `pallets` as `pal` ON `pal`.`reference`=`mh`.`mhref`\r\nLEFT JOIN `customers` as `cus` ON `cus`.`code`=`pal`.`customer`\r\nLEFT JOIN `suppliers` as `sup` ON `sup`.`code`=`pal`.`supplier`\r\nWHERE `mh`.`mhref` LIKE \'%@mhref%\' AND `mh`.`mhdate` >= @from  and `mh`.`mhdate` <= @to and `mh`.`type` like \'pallet%\'\r\nORDER BY `mh`.`mhdate`', 'NjEyZGU3ZmZmMTg4Nw', 1),
(5, 'removed_pallets', 'Showing removed pallets info', 1, NULL, NULL, '', NULL, 'SELECT \r\n`pal`.`reference`,\r\n`pal`.`operator` as \'Created By\',\r\n`pal`.`supplier`,\r\n`pal`.`sorder` as \'Supplier Ref\',\r\n`pal`.`customer`,\r\n`pal`.`corder` as \'Customer Ref\',\r\n`pal`.`size`,\r\n`pal`.`stack`,\r\n`pal`.`height`,\r\n`pal`.`location`,\r\n`mv`.`mhuser` as \'Removed By\',\r\n`mv`.`mhdate` as \'Removed On\'\r\nFROM `pallets` as `pal`\r\nLEFT JOIN `movements_history` as `mv` ON `mv`.`mhref`=`pal`.`reference` AND `mv`.`mhtype`=3\r\nWHERE `pal`.`status` =\'-1\';', 'NjEyZGU3ZmNhMzk3Yg', 1),
(6, 'removed_jobs', 'Showing all removed jobs', 1, NULL, NULL, '', NULL, 'SELECT * FROM vw_deleted_orders', 'NjEyZGU3ZmZmMTg4Nw', 1),
(7, 'allpallets_details', 'Showing all pallets details (not include deleted or despatched)', 1, NULL, NULL, '', NULL, 'SELECT * FROM vw_allpalletsdetails', 'NjEyZGU4NjM0ODIyNw', 1),
(8, 'customer pallets qty by type', 'Shows qty of each pallet type for customer', 1, NULL, NULL, 'customer||CustomersField', NULL, 'SELECT\r\n`pal`.`customer` as \'Customer\',\r\n(SELECT count(`p1`.`pid`) FROM `pallets` as `p1` WHERE `p1`.`customer`=`pal`.`customer` AND `p1`.`status`=0) as \'Need Checking\',\r\n(SELECT count(`p2`.`pid`) FROM `pallets` as `p2` WHERE `p2`.`customer`=`pal`.`customer` AND `p2`.`status`=1) as \'Pre-Dimm\',\r\n(SELECT count(`p2`.`pid`) FROM `pallets` as `p2` WHERE `p2`.`customer`=`pal`.`customer` AND `p2`.`status`=25) as \'Incomplete 25%\',\r\n(SELECT count(`p2`.`pid`) FROM `pallets` as `p2` WHERE `p2`.`customer`=`pal`.`customer` AND `p2`.`status`=50) as \'Incomplete 50%\',\r\n(SELECT count(`p2`.`pid`) FROM `pallets` as `p2` WHERE `p2`.`customer`=`pal`.`customer` AND `p2`.`status`=75) as \'Incomplete 75%\',\r\n(SELECT count(`p2`.`pid`) FROM `pallets` as `p2` WHERE `p2`.`customer`=`pal`.`customer` AND `p2`.`status`=100) as \'Dimmed\'\r\nFROM `pallets` as `pal`\r\nWHERE customer LIKE \'%@customer%\' AND status > -1', 'NjEyZGU4NjM0ODIyNw', 0),
(9, 'palletsdisp', 'Pallets dispatched but order not dimmed', 1, NULL, NULL, '', NULL, 'SELECT * FROM vw_palletsinfoorderstatus', 'NjEyZGU3ZmNhMzk3Yg', 0),
(10, 'palletsdisp_no_load_task', 'Pallets despatched but there is no load task for them', 1, NULL, NULL, '', NULL, 'SELECT\r\n`tbl`.`reference`,\r\n`tbl`.`operator`,\r\n`tbl`.`supplier`,\r\n`tbl`.`sorder` as `supplier_order`,\r\n`tbl`.`customer`,\r\n`tbl`.`corder` as `customer_order`,\r\n`tbl`.`location`,\r\n`tbl`.`xsnumber`\r\nFROM vw_palletsloadtaskmovement as `tbl`\r\nWHERE `loadref` is null;', 'NjEyZGU3ZmNhMzk3Yg', 1),
(11, 'pallets_inout_by_cust', 'Qty of pallets in and out by Customer', 1, NULL, NULL, '', NULL, 'SELECT * FROM `vw_customerspalletsqty` as `vw` WHERE `vw`.`in_qty` > 0 order by `vw`.`in_qty` DESC', 'NjEyZGU3ZmZmMTg4Nw', 1),
(12, 'live_pallets_qty_by_size', 'Actual pallets qty in warehouse filtered by pallet size', 1, NULL, NULL, '', NULL, 'SELECT \r\n`ps`.`name`,\r\n(SELECT count(`pal`.`pid`) FROM `pallets` as `pal` WHERE `pal`.`size`=`ps`.`name` and `pal`.`status` > -1) as `qty`\r\nFROM `pallets_size` as `ps`\r\nWHERE `ps`.`enabled`=1;', 'NjEyZGU3ZmZmMTg4Nw', 1),
(13, 'pallest_no_livejobs', 'Returns pallets with no live jobs (orders)', 1, NULL, NULL, '', NULL, 'SELECT \r\n`corder` as `JOB`, \r\n`dead` as `PALLETS QTY`\r\nFROM vw_palletslivedeadorders WHERE dead >0', 'NjEyZGU3ZmZmMTg4Nw', 1);
