(52, 'orders', 'orders_status_types_cus', '3=Pre-Dimms|4=Being Dimm|5=Dimmed|-1=Deleted|-2=Dispatched', 'textlong', 'Orders status types.  Seperate field by | and seperate key/value with = (key1=value1|key2=value2) '),
(53, 'collections', 'sql_jobs_for_load', 'SELECT\r\n`ord`.`reference`,\r\n`cus`.`iseu`,\r\n`ord`.`location`,\r\n`li`.`loadref` as \'load\',\r\n`li`.`status`,\r\ncount(`pal`.`corder`) as \'pallet_qty\',\r\ncount(`eur`.`psid`) as \'eur_qty\',\r\ncount(`neur`.`psid`) as \'noneur_qty\'\r\nFROM `orders`  as `ord`\r\nLEFT JOIN `pallets` as `pal` on `pal`.`corder`=`ord`.`reference` AND `pal`.`status` > -1\r\nLEFT JOIN `pallets_size` as `eur` on `eur`.`name`=`pal`.`size` AND `eur`.`type`=1\r\nLEFT JOIN `pallets_size` as `neur` on `neur`.`name`=`pal`.`size` AND `neur`.`type`=0\r\nLEFT JOIN `customers` as `cus` on `cus`.`code`=`ord`.`owner`\r\nLEFT JOIN `loads_items` as `li` on `li`.`pallref`=`pal`.`reference`\r\nWHERE (`ord`.`status`=(SELECT `value` FROM `settings` WHERE `settings`.`param`=\'orders_status_comp\') OR `ord`.`status`=(SELECT `value` FROM `settings` WHERE `settings`.`param`=\'orders_status_pick\'))\r\ngroup by `pal`.`corder`,`ord`.`reference`,`cus`.`iseu`,`ord`.`location`,`li`.`loadref`,`li`.`status`;', 'textlong', 'SQL command which return Job Codes Info for loads'),
